import React from 'react'
import './chat.css';
import LogoSearch from '../../components/logoSearch/LogoSearch';

const Chat = () => {
    return (
        <div className='Chat'>
            {/* Left Side */}
            <div className="Left-side-chat">
                <LogoSearch />
                <div className="Chat-container">
                    <h2>Chats</h2>
                    <div className="Chat-list">
                        Conversation Header
                    </div>
                </div>
            </div>

            {/* Right Side */}
            <div className="Right-side-chat">
                Rigth Side
            </div>
        </div>
    )
}

export default Chat
